// ProfilePage.js
import React from 'react';

function ProfilePage({ user }) {
    if (!user) {
        return <p>Loading user profile...</p>;
    }

    const name = user.idTokenClaims?.name || user.username || "User";
    const email = user.idTokenClaims?.email || user.idTokenClaims?.emails?.[0] || "No email provided";
    const givenName = idTokenClaims.given_name || "N/A";
    const surname = idTokenClaims.family_name || "N/A";
    const objectId = idTokenClaims.oid || "N/A";
    const userRoles = idTokenClaims.roles || []; 

    return (
        <div>
            <h1>Welcome, {name}!</h1>
            <p>Email: {email}</p>
            <p><strong>Given Name:</strong> {givenName}</p>
            <p><strong>Surname:</strong> {surname}</p>
            <p><strong>Object ID:</strong> {objectId}</p>
            <p><strong>User Roles:</strong> {userRoles.join(', ') || "No roles assigned"}</p>
        </div>
    );
}

export default ProfilePage;
